import React from 'react';
import { 
  Card,
  CardContent,
  Typography,
  Grid,
  Container
} from '@mui/material';

const MatchList = ({ matches }) => {
  console.log('MatchList received matches:', JSON.stringify(matches, null, 2));

  if (!matches || matches.length === 0) {
    return (
      <Container>
        <Typography variant="body1">No tennis matches currently available</Typography>
      </Container>
    );
  }

  return (
    <Container>
      <Grid container spacing={2}>
        {matches.map((match, index) => {
          console.log('Processing match:', JSON.stringify(match, null, 2));
          const rapidData = match.rapid_data?.raw_event_data;
          const betsData = match.betsapi_data;

          return (
            <Grid item xs={12} md={6} key={index}>
              <Card>
                <CardContent>
                  {rapidData ? (
                    <>
                      <Typography variant="h6" gutterBottom>
                        {rapidData.team1} vs {rapidData.team2}
                      </Typography>
                      <Typography color="textSecondary">
                        Event ID: {rapidData.eventId}
                      </Typography>
                    </>
                  ) : null}
                  {betsData ? (
                    <>
                      <Typography color="textSecondary">
                        Bet365 ID: {betsData.bet365_id}
                      </Typography>
                      {betsData.inplay_event && (
                        <Typography color="textSecondary">
                          Match Status: {betsData.inplay_event.status}
                        </Typography>
                      )}
                    </>
                  ) : null}
                </CardContent>
              </Card>
            </Grid>
          );
        })}
      </Grid>
    </Container>
  );
};

export default MatchList;
